import { Helmet } from 'react-helmet';
import GlobalStyles from './Components/GlobalStyles/GlobalStyles';
import Nav from './Components/Navbar/Nav';

function App() {
  return (
    <>
      <Helmet>
        <link
          href="https://fonts.googleapis.com/css2?family=Merriweather&display=swap"
          rel="stylesheet"
        />
      </Helmet>

      <GlobalStyles />
      <Nav />
    </>
  );
}

export default App;
